window.bookSummaryJSON = "<p><b><i>How hard could it be?</i></b></p> <p>You're back? And you want to know what happened next? Well okay then, pull up a chair, and I'll tell you what went down in Minot.</p> <p>Yes. North Dakota. <i>That </i>Minot. Just goes to show not all the strange is confined to the big city.</p> <p>We went up there looking for the missing daughter of a friend of mine and wound up neck-deep in trouble when instead of the missing girl, we found a drug ring.</p> <p>And a mind-controlled cult.</p> <p>Ruse did something stupid, Cougs got jealous, Kahni caused trouble, <i>I</i> got arrested again, and by the end of it, half the town was gunning for my hide.</p> <p>Interested? Well grab a drink and some snacks, because you'll <i>never</i> believe this....</p> <p><b>Warning: This book has adult themes including a slow-burn harem and violence.</b></p>"; 
